import {Link} from 'react-router-dom'


function Header (){

    return (
        <div>
            <img src={Logo} className ="Logo" alt="Logo"/>
                <nav>
                    <Link Accueil>Accueil</Link>
                    <Link>A Propos</Link>
                </nav>
        </div>

)

}

export default Header;
